    <div>
      <div className="card">
        <div className="cardBody">
          <img src="/images/2021Feb.jpg" className="h-40 w-40 py-1" />
          လှူဒါန်းရန် - 09-752957515 <br />
          09-766876268
        </div>
        <div className="cardFooter">
          <Link to="/cdmdetail/1">၂ /၂၀၂၁ ခိုင်မြဲသောလက်များ</Link>
        </div>
      </div>
    </div>
  );
}

export default CDM;
